import "./App.scss";
import Header from "./components/Header/Header";
import { Link, Outlet } from "react-router-dom";
const App = () => {
  return (
    <div className="app-container">
      <Header></Header>
      <div>Test link</div>
      <Link to="/users" className="btn btn-primary">
        Go to User Page
      </Link>
      <Link to="/admins" className="btn btn-secondary">
        Go to Admin Page
      </Link>
    </div>
  );
};

export default App;
